import React from 'react';
import c from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = () => {
    return (
        <div>
            My posts
            <div>
                New post
            </div>
            <div className={c.posts}>
                <Post message = "Hello, I'm Natalie" numberOfLikes = '15' />
                <Post message = 'Hi! How are you?'  numberOfLikes = '35' />
            </div>
        </div>
    )
}

export default MyPosts;
